import React from 'react';

class Weather extends React.Component{
render(){
    return (
        <React.Fragment>
            <h1>Météo de la ville</h1>
            <p>ville: {this.props.ville}</p>
            <p>pays: {this.props.pays}</p>
            <p>Température: {this.props.temperature}</p>
            <p>Description: {this.props.description}</p>
            <p>Humidité: {this.props.humidite}</p>
            <p>{this.props.erreur }</p>

        </React.Fragment>
    )
    }
}

export default Weather
